import React from "react";
// import store from '../redux/store'
import ContractorProfile from '../components/ContractorProfile'

export default class ContractorProfileContainer extends React.Component {
  state = {};

  render() {

    return (
      <div>
        <ContractorProfile contractor={this.props.contractor}/>

        <Route
              exact
              path="/contractor/task/:id"
              render={() => {

                 return !isEmpty(this.state.currentContractor) ? (
                <ContractorProfileContainer contractor={this.state.currentContractor}/>
                ) : (
                  <Redirect to="/login/contractor" />
                )
              }}
            />
      </div>
    );
  }
}
